import { useState } from "react";
import { dataTickets } from "../../utils/mockApi";

import "./tickets.css";

const Tickets = () => {
  const [download, setDownload] = useState(3);

  return (
    <div className="tikets-container">
      <div className="tickets-container__item">
        <div className="tickets-container__item__info">
          <div className="tickets-container__item__info__price">2</div>
          <div className="tickets-container__item__info__time"></div>
          <div className="tickets-container__item__info__company"></div>
        </div>
      </div>
    </div>
  );
};

export default Tickets;
